import{_ as c}from"./chunks/index.VAya1KE4.js";import{c as a,o,G as e,k as d}from"./chunks/framework.BFEalnvt.js";import"./chunks/theme.B1I7hsVa.js";import"./chunks/getArrayRandomItem.LhrzGfRF.js";const l=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"params":{"pkg":147,"idList":[1158,1109,996,997,950,916,840,801,759,680,634,317,65,378,73,316,318,150,758,493,485,80,371,158,227,379,179,147],"data":{"id":147,"name":"安东","summary":"安东·伊万诺夫","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/05/25/76099754/b323dfb93362d929e64562c004cdd0e1_79025806971412847.png","avatar":{"m":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/30/76099754/32055fd42508cd28dd7cfa9ce916cfd7_839865061509013684.png","pc":"https://act-upload.mihoyo.com/nap-obc-indep/2024/06/25/76099754/27b663260c481fefc58c79ce82bbed30_5213909157801004436.png"},"attrs":[["稀有度","A"],["属性","电"],["特性","强攻"],["阵营","白祇重工"]],"destiny":[["LEVEL1热身运动","[电钻攻击]命中敌人时，能够额外回复能量；同一招式内，该效果最多为安东回复5点能量。「醒了吗？转起来，兄弟！」「跟上节奏，现在是早操时间！」"],["LEVEL2气势如虹","发动[强化特殊技]进入[爆发状态]时，获得等同于安东7.5%生命值上限的护盾；在[爆发状态]下进入接战状态或换入前场时，将刷新护盾效果，15秒内最多触发一次；退出[爆发状态]时，护盾效果结束。经过长期的艰苦训练，有少部分幸运儿在进行高强度运动时，会爆发绝佳气势，超水平发挥自身能力，俗称「领域」。现在，你准备好一起动起来，进入「领域」了吗？——燃油饮独家冠名节目，「早安，热血上班族！」"],["LEVEL3轮岗培训","[普通攻击]、[闪避]、[支援技]、[特殊技]、[连携技]技能等级+2什么都会一点只能叫平庸，但在情况复杂多变的空洞作业现场，多一个技能有时就意味着多一个突破困境的可能。"],["LEVEL4一起燃烧！","发动[连携技]或[终结技]时，全队暴击率提升10%，持续12秒。「想想平时训练的感觉，一起动起来！」当安东开始认真时，所有人的动作都会变得利索起来。毕竟，如果跟不上他的节拍，明天的早操是要单独加练的。"],["LEVEL5全栈专家","[普通攻击]、[闪避]、[支援技]、[特殊技]、[连携技]技能等级+2什么都会一点只能叫平庸，但如果你足够坚定，从「会一点」变成「很擅长」，那你就是全能！"],["LEVEL6突破极限","[打桩攻击]造成暴击时，[普通攻击：热血上工操(爆发状态)]和[闪避反击：过载钻机(爆发状态)]造成的伤害提升4%，最多叠加6层，持续30秒，重复触发时刷新持续时间。「哦，兄弟！你也想燃烧吗！」每当安东想要突破极限时，「兄弟」便会爆发出惊人的转速，以嗡鸣声应和着他的意志。"]],"skill":[{"title":"普通攻击：热血上工操","desc":"点按发动：向前方进行至多四段的混合攻击，造成物理伤害；第四段攻击为[打桩攻击]。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/05/18/82500917/90fbddc0350098b21806e633a8dd7c41_9194086458224276224.gif"},{"title":"普通攻击：热血上工操(爆发状态)","desc":"[爆发状态]下，点按发动：向前方进行至多三段的混合攻击，造成大量电属性伤害；在第二段[电钻攻击]和第三段[打桩攻击]期间，连点或长按可延长招式的持续时间。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/82500917/affbe33bf3a1ed2798ae9c06101ddf4a_8786803212856517427.gif"},{"title":"闪避：动起来","desc":"点按发动：快速的冲刺闪避；招式期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/82500917/bb4ae496000d05269e4bcea4b7c874b5_2782402926508325802.gif"},{"title":"冲刺攻击：硬碰硬","desc":"闪避时，点按发动：向前方进行撞击，造成物理伤害。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/82500917/26f96e9f7b15ab39f071c8f4db7d723d_6058971285200085357.gif"},{"title":"闪避反击：回敬拳击","desc":"触发[极限闪避]后，点按发动：对前方敌人发动连续重拳，造成物理伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/82500917/c1f77501ddcdd100337f611f783ea48c_2229216199814340600.gif"},{"title":"闪避反击：过载钻机(爆发状态)","desc":"[爆发状态]下，触发[极限闪避]后，点按发动：对前方敌人使用[电钻攻击]，造成大量电属性伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/82500917/a25c729af7e771ab1b74fcde6d0c3179_1287046327110704822.gif"},{"title":"快速支援：并肩作战","desc":"当前操作中的角色被击飞时，点按发动：对前方敌人发动连续重拳，造成物理伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/82500917/682f3e0ca1c17a771a2efefa14644e79_6203195334906362928.gif"},{"title":"快速支援：援护钻击(爆发状态)","desc":"当前操作中的角色被击飞时，点按发动：对前方敌人发动[电钻攻击]，造成大量电属性伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/82500917/a9c51fce427fcfffd6fac822d1d35a49_8705773314302079444.gif"},{"title":"招架支援：钢腕","desc":"前场角色即将被攻击时，点按发动：招架敌人的攻击，累积大量失衡值；具有较为优秀的招架性能，承受高强度攻击时[支援点数]的消耗降低；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/82500917/b5da2ce58a1bb65ec7e6fa3f0363a24e_7777655339107257765.gif"},{"title":"支援突击：极限突进","desc":"发动[招架支援]后，点按发动：对前方敌人发动[电钻攻击]并以[打桩攻击]收尾，造成电属性伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/82500917/2b24e4d7760befffabf68339846e5441_7842543507736916526.gif"},{"title":"特殊技：兄弟，转起来！","desc":"点按发动：对前方直线区域内敌人发动[打桩攻击]，造成电属性伤害；招式发动期间抗打断等级提升。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/05/18/82500917/ae5d060573f4b6481e9fdd0230034bf3_7437439755191916589.gif"},{"title":"强化特殊技：兄弟，突破天际！","desc":"能量足够时，若点按发动：对前方直线区域内敌人发动多段[打桩攻击]，造成大量电属性伤害；招式发动期间拥有无敌效果；招式发动后，安东将进入[爆发状态]；在[爆发状态]下，安东会使用更加强力的招式，造成大量电属性伤害，并随招式命中目标，逐渐消耗能量，持续至能量耗尽。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/82500917/bdb7f34065040a563d9372637cd5aebb_8838616113825079762.gif"},{"title":"特殊技：爆发钻击(爆发状态)","desc":"[爆发状态]下，点按发动：对前方敌人发动[打桩攻击]，造成电属性伤害；招式发动期间抗打断等级提升。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/82500917/22a5d660ad0ef394aafab598f22b5345_1451891565382281566.gif"},{"title":"连携技：转转转！","desc":"触发[连携技]时，选择对应角色发动：对前方地面进行大范围[打桩攻击]，对区域内的敌人造成大量电属性伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/82500917/7eaa5c81d37de389ad77c1e59dab8d94_8351988621942092334.gif"},{"title":"终结技：转转转转转！","desc":"喧响等级达到[极]时，点按发动：对前方地面进行大范围[打桩攻击]，对区域内的敌人造成大量电属性伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/82500917/416d62d1b741308c686d2d1f7d3d97eb_1772069957439381186.gif"},{"title":"核心技","desc":"核心被动：兄弟齐心！安东发动[打桩攻击]时，招式造成的伤害提升12%，发动[电钻攻击]时，招式造成的伤害提升20%。（此处数据为初始数据）额外能力：通力合作队伍中存在与自身属性或阵营相同的角色时触发：安东进入[爆发状态]后，每触发4次暴击，下一次攻击命中处于[感电]状态下的敌人时，能够额外结算一次[感电]伤害，伤害效果等同于原本的45%，0.5秒内最多触发一次。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/07/01/82500917/56c0eb9d538ca9d751fbd46e36265dda_1657082952086797865.gif"}]},"favModalLocalKey":"vitepress_game_zzz_role_fav_modal","favLocalKey":"vitepress_game_zzz_role_fav"},"relativePath":"game/zzz/role/147.md","filePath":"game/zzz/role/[pkg].md"}'),t={name:"game/zzz/role/147.md"},_=Object.assign(t,{setup(i){return(p,n)=>(o(),a("div",null,[e(d(c))]))}});export{l as __pageData,_ as default};
